      <div className="bg-[#FFAF9A]"></div>
      <div className="bg-[#E3E3D3]"></div>
      <div className="bg-[#FFAF9A]"></div>
      <div className="bg-[#FFAF9A]"></div>
    </div>
  );
};

export default Design;
